pragma solidity ^0.4.23;

import "../external/CloneFactory.sol";
import "./TokenCore.sol";

contract TokenCoreFactory is CloneFactory {

    TokenCore public blueprint;

    constructor (TokenCore _blueprint) public {
        blueprint = _blueprint;
    }

    function createTokenCore (address owner) public returns (TokenCore) {
        TokenCore tokenCore = TokenCore(createClone(blueprint));
        tokenCore.initialize(owner);
        emit CreateTokenCore_event(msg.sender, owner, tokenCore);

        return tokenCore;
    }
    
    event CreateTokenCore_event(address indexed caller, address indexed owner, TokenCore tokenCore);
}
